import { Button } from '@mui/material';

const EventItem = ({ event }) => {
    const { name, description } = event;

    return (
        <div className='event-card'>
            <h3>{name}</h3>
            <Button variant='outlined'>Edit</Button>
        </div>
    );
};

export default EventItem;
